var scene, renderer, camera;
var controls, angle = 0, object;

init();
animate();

function init() {
  scene = new THREE.Scene();
  
  renderer = new THREE.WebGLRenderer();
  renderer.setSize(window.innerWidth, window.innerHeight);
  renderer.setClearColor(0x888888);
  
  document.body.appendChild(renderer.domElement);

  camera = new THREE.PerspectiveCamera(50, window.innerWidth / window.innerHeight, 1, 1000);
  camera.position.z = 500;
  controls = new THREE.OrbitControls(camera,
    renderer.domElement);

  var gridXZ = new THREE.GridHelper(100, 10);
  gridXZ.setColors(new THREE.Color(0xff0000), new THREE.Color(0xffffff));
  scene.add(gridXZ);

	// instantiate a loader
  var loader = new THREE.ObjectLoader();

  // assuming we loaded a JSON structure from elsewhere
  object = loader.parse( getModelJson() );

  scene.add(object);
  //
  var light = new THREE.PointLight(0xffffff);
  light.position.set(100, 100, 100);
  scene.add(light);

  THREE.ImageUtils.crossOrigin = '';

  var basicMaterial = new THREE.MeshLambertMaterial({
      side: THREE.DoubleSide,
      map: THREE.ImageUtils.loadTexture('http://i.imgur.com/tqeiQzQ.jpg')
  });
  var body = new THREE.Mesh(
  	new THREE.BoxGeometry(50, 5, 50),
    basicMaterial
  );
  scene.add(body);
  //
  window.addEventListener('resize', onWindowResize, false);
}

function onWindowResize() {
  camera.aspect = window.innerWidth / window.innerHeight;
  camera.updateProjectionMatrix();
  renderer.setSize(window.innerWidth, window.innerHeight);
}

function animate() {
  controls.update();
  angle -= 0.005;
  object.position.set(50 * Math.cos(angle), 75, 50 * Math.sin(angle));
  object.rotation.y = -angle;
  requestAnimationFrame(animate);
  renderer.render(scene, camera);
}
